// src/components/analytics/Analytics.jsx
import React, { useMemo, useState } from "react";
import MetricsGrid from "./MetricsGrid";
import MonthlyTrendsChart from "./userCharts/MonthlyTrendsChart";
import GrowthAnalyticsChart from "./userCharts/GrowthAnalyticsChart";
import GeoDistributionChart from "./userCharts/SolarContributionChart";
import DeviceAnalyticsChart from "./userCharts/ReservesTrend";
import { useAnalyticsData } from "./hooks/useAnalyticsData";

function safeParse(json, fallback) {
  try {
    const v = JSON.parse(json);
    return v ?? fallback;
  } catch {
    return fallback;
  }
}

const asMs = (v) => {
  const t = new Date(v).getTime();
  return Number.isFinite(t) ? t : null;
};

const normalizeDaily = (rows, dateKey) =>
  (rows || [])
    .map((r) => ({
      ...r,
      Timestamp: asMs(r?.[dateKey] ?? r?.Timestamp ?? r?.Date),
    }))
    .filter((r) => r.Timestamp != null)
    .sort((a, b) => a.Timestamp - b.Timestamp);

const normalizeMonthly = (rows, valueKey) =>
  (rows || [])
    .map((r) => {
      const y = Number(r?.Year);
      const m = Number(r?.Month);
      if (!y || !m) return null;
      return {
        ...r,
        [valueKey]: Number(r?.[valueKey]) || 0,
        Timestamp: asMs(`${y}-${String(m).padStart(2, "0")}-01`),
      };
    })
    .filter(Boolean)
    .sort((a, b) => a.Timestamp - b.Timestamp);


export default function Analytics() {
  const [yearTab, setYearTab] = useState("2024");
  const [growthTab, setGrowthTab] = useState("Week");

  // monitorId from localStorage (first monitor)
  const monitors = useMemo(() => safeParse(localStorage.getItem("monitors"), []), []);
  const monitorId = useMemo(() => {
    const first = monitors?.[0];
    const id = first?.Monitor_ID ?? first?.monitor_id;
    return id != null ? String(id) : "";
  }, [monitors]);

  const {
    loading,
    err,
    todayCons,
    todayProd,
    mtdCons,
    mtdProd,
    solarTodayGenerated,
    solarTodayEff,
    avgTemp7,
    avgHumidity7,
    consM,
    prodM,
    cons7,
    cons30,
    prod7,
    prod30,
    solar7,
    reserves7,
  } = useAnalyticsData(monitorId);

  return (
    <section className="analytics-section" id="analytics">
      <div className="dashboard-container">
        <h2 className="section-title">Advanced Analytics</h2>

        {!monitorId && (
          <div className="muted" style={{ marginTop: 10 }}>
            No monitor found for this account. (Try logging in again.)
          </div>
        )}

        {loading && monitorId && <div className="muted">Loading analytics...</div>}
        {err && <div className="error">{err}</div>}

        <MetricsGrid
          metrics={[
            { value: `${todayCons.toFixed(2)} kWh`, label: "Today's Consumption" },
            { value: `${todayProd.toFixed(2)} kWh`, label: "Today's Production" },
            { value: `${(mtdCons || 0).toFixed(1)} kWh`, label: "Last 30 Days Consumption" },
            { value: `${(mtdProd || 0).toFixed(1)} kWh`, label: "Last 30 Days Production" },
            { value: `${solarTodayEff.toFixed(1)}%`, label: "Panel Efficiency (Today)" },
            { value: `${avgTemp7.toFixed(1)}Â°C`, label: "Avg Temp (7d)" },
          ]}
        />

        <div className="charts-grid">
          <MonthlyTrendsChart
            activeYear={yearTab}
            onChangeYear={setYearTab}
            consumptionMonthly={consM}
            productionMonthly={prodM}
          />

          <GrowthAnalyticsChart
            activeRange={growthTab}
            onChangeRange={setGrowthTab}
            consumptionDaily={cons7}
            consumptionDaily30={cons30}
            productionDaily={prod7}
            productionDaily30={prod30}
          />

          {/* Repurposed: Energy Mix (Solar vs Consumption) */}
          <GeoDistributionChart
            title="â˜€ï¸ Solar Contribution"
            subtitle="Last 7 days"
            solarDaily={solar7}
            consumptionDaily={cons7}
          />

          {/* Repurposed: Reserves trend */}
          <DeviceAnalyticsChart
            title="ðŸª« Reserves Trend"
            subtitle="Last 7 days"
            reservesDaily={reserves7}
            solarTodayGenerated={solarTodayGenerated}
          />
        </div>
      </div>
    </section>
  );
}
